import search from '../images/search_icon.png';
import Settings from '../images/settings.png';
import Info from '../images/Info1.png';
import stud from '../images/shortcut-stud.png';
import team from '../images/shortcut-teams.png';
import ITLogo from '../images/IT-Designer.png';
import '../style/App.css';

function Homepage() {
  return (
    <div className="Homepage">
      <header className="Homepage-header">    
        {/* <img src={Menu} className="Menu" alt="menu" />   */}
        <img src={Info} className="Info" alt="info" />
        <img src={Settings} className="Settings" alt="settings" />
      </header>
      <div className="greeting-text">
         <b>Willkommen Max Mustermann</b>
      </div>
      <div className="search-bar">
        <div className=''>
          <img src={search} className="search-icon" alt="search" />
        </div>
      </div>
      <div className="box-field">
        <div className="box1">
          <a href="#students"><img src={stud} className="Student" alt="student" />Studenten</a>
        </div>
        <div className="box2">
          <a href="teams"><img src={team} className="Team" alt="team" />Teams</a>
        </div>
        <div className="box3">
          <a href="https://it-designers-gruppe.de/" target="_blank"><img src={ITLogo} className="Logo" alt="logo" />Website</a>
        </div>
      </div>
    </div>
  );
}

export default Homepage;
